result_notes:
This site contains the monthly Ambulance Quality Indicators (AQI) Statistical
Notes, spreadsheets, and text files. The AQI comprise the Systems Indicators
(AmbSYS), and the Clinical Outcomes (AmbCO) which are published three months
after AmbSYS. Data are split by month, and by each of the eleven Ambulance
Trusts in England.

Background information for the statistics below is on the [AQI landing
page](https://www.england.nhs.uk/statistics/statistical-work-areas/ambulance-
quality-indicators/), including:

  * links to pages like this one but for 2011-12 to 2013-14;
  * text files and time series spreadsheets with all data back to April 2011;
  * the specification guidance used by data providers;
  * a Quality Statement, including user engagement and revisions policy;
  * contact details for these statistics.
